import React from "react";
import "./table.css";

const Genericpage = ({
    pageName,
    tableHeaderComponent,
    tableInfoComponent,
    // editButtonComponent,
    // deleteButtonComponent,
    // createButtonComponent,
}) => {
    return (
        <section>
            <h2>{pageName}</h2>
            <table className="dataTable">
                <thead>
                    <tr>{tableHeaderComponent}</tr>
                </thead>
                <tbody>
                    <tr>{tableInfoComponent}</tr>

                    {/* {editButtonComponent}
                    {deleteButtonComponent} */}
                </tbody>
            </table>
            {/* <div>{createButtonComponent}</div> */}
        </section>
    );
};

export default Genericpage;
